import React, { useState, useEffect } from "react";
import { Table, Button } from "antd";
import { API_URL } from '../utils/constants';

function FileList() {
  const [files, setFiles] = useState([]);

  useEffect(() => {
    fetch(`${API_URL}/getAllFiles`)
      .then(response => response.json())
      .then(data => setFiles(data));
  }, []);

  const columns = [
    {
      title: "ID",
      dataIndex: "id",
      key: "id",
    },
    {
      title: "Title",
      dataIndex: "title",
      key: "title"
    },
    {
      title: "Description",
      dataIndex: "description",
      key: "description"
    },
    {
      title: "Model",
      dataIndex: "model",
      key: "model"
    },{
      title: 'Action',
      key: 'action',
      render: (_, record) => (
        <Button style="primary">
          <a onclick>Delete</a>
        </Button>
      ),
    },
    // {
    //   title: "File Path",
    //   dataIndex: "file_path",
    //   key: "file_path"
    // },
    {
      title: "Timestamp",
      dataIndex: "timestamp",
      key: "timestamp"
    }
  ];

  return (
    <Table dataSource={files} columns={columns} rowKey="id" />
  );
}

export default FileList;
